*/

import PropTypes from "prop-types";
import React from "react";
import { useReducer } from "react";
// import union from "../../img/"

export const Component = ({ property1, className, pullDataClassName }) => {
  const [state, dispatch] = useReducer(reducer, {
    property1: property1 || "group-30",
  });

  return (
    <div
      className={`${state.property1 === "group-30" ? "border border-solid" : ""} ${
        state.property1 === "group-30" ? "border-black" : ""
      } ${state.property1 === "group-1410082888" ? "w-[126px]" : "w-[122px]"} ${
        state.property1 === "group-1410082888" ? "h-[88px]" : "h-[47px]"
      } ${state.property1 === "group-30" ? "rounded-[23.5px]" : ""} ${
        state.property1 === "group-30" ? "bg-black" : ""
      } ${state.property1 === "group-30" ? "relative" : ""} ${className}`}
      onMouseLeave={() => {
        dispatch("mouse_leave");
      }}
      onMouseEnter={() => {
        dispatch("mouse_enter");
      }}
    >
      <div
        className={`${state.property1 === "group-30" ? "[font-family:'Poppins',Helvetica]" : ""} ${
          state.property1 === "group-1410082888" ? "w-[214px]" : ""
        } ${state.property1 === "group-1410082888" ? "left-[-88px]" : "left-[33px]"} ${
          state.property1 === "group-30" ? "tracking-[0]" : ""
        } ${state.property1 === "group-30" ? "text-xs" : ""} ${state.property1 === "group-30" ? "top-3.5" : ""} ${
          state.property1 === "group-30" ? "text-white" : ""
        } ${state.property1 === "group-30" ? "font-semibold" : ""} ${
          state.property1 === "group-1410082888" ? "h-[88px]" : ""
        } ${state.property1 === "group-30" ? "text-center" : ""} ${
          state.property1 === "group-30" ? "leading-[normal]" : ""
        } ${state.property1 === "group-1410082888" ? "relative" : "absolute"} ${pullDataClassName}`}
      >
        {state.property1 === "group-30" && <>Pull Data</>}

        {state.property1 === "group-1410082888" && (
          <>
            <div className="absolute w-[124px] h-[47px] top-0 left-[88px]">
              <div className="relative w-[122px] h-[47px] bg-black rounded-[23.5px] border border-solid border-black">
                <div className="absolute top-[15px] left-[33px] [font-family:'Poppins',Helvetica] font-semibold text-white text-xs text-center tracking-[0] leading-[normal]">
                  Pull Data
                </div>
              </div>
            </div>
            <img className="absolute w-[126px] h-11 top-11 left-[88px]" alt="Union" src="../../img/union.svg" />
            <p className="absolute top-[58px] left-0 [font-family:'Poppins',Helvetica] font-normal text-black text-sm tracking-[0] leading-[normal]">
              Pull your data from AppFolio
            </p>
          </>
        )}
      </div>
    </div>
  );
};

function reducer(state, action) {
  switch (action) {
    case "mouse_enter":
      return {
        ...state,
        property1: "group-1410082888",
      };

    case "mouse_leave":
      return {
        ...state,
        property1: "group-30",
      };
  }

  return state;
}

Component.propTypes = {
  property1: PropTypes.oneOf(["group-30", "group-1410082888"]),
};
